import React from 'react'
import { useDispatch } from 'react-redux';
import {playButtonfunc} from './redux/actionType'

const buttonPlayerStyle = {
  width: "50%",
  display: "flex",
  paddingTop: "100px",
  flexDirection: "column",
};


const dispatch = useDispatch();
export default function ButtonPlayer() {


  return (
    <div style={buttonPlayerStyle}>
      {[...Array(3)].map((_, idx) => (
        <button key={idx} onClick={dispatch(playButtonfunc(idx))}>Click{idx + 1}</button>
      ))}
    </div>
  );
}
